import React from "react";
import SearchBar from './SearchBar';
import { Link } from "react-router-dom";
import { Navigate, Linked } from "../../styles/styled-components"; 

export default function Nav(props){
    return(
            <Navigate>
                <Link to="/home" style={{textDecoration: "none"}}>
                    <Linked>Home</Linked>
                </Link>

                <Link to="/about" style={{textDecoration: "none"}}>
                    <Linked>About</Linked>
                </Link>

                <Link to="/home" style={{textDecoration: "none"}}>
                    <Linked onClick={() => {
                        const possibleNumbers = [1, 2, 3, 4]; // array con los números posibles
                        const randomIndex = Math.floor(Math.random() * possibleNumbers.length); // índice aleatorio
                        const randomNum = possibleNumbers.splice(randomIndex, 1)[0]; // sacar el número aleatorio del array
                        
                        // actualizar el estado con el número aleatorio generado
                        props.onSearch(randomNum);}}
                    >Random</Linked>
                </Link>

                <Link to="/favorites" style={{textDecoration: "none"}}>
                    <Linked onClick={() => {}}
                    >Favorites</Linked>
                </Link>

                <SearchBar onSearch={props.onSearch} />

                <Link to="/" style={{textDecoration: "none"}}>
                    <Linked onClick = {props.logOut}
                    >Logout</Linked>
                </Link>
            </Navigate>
    )
}
